trap:
Earthquake Trap: DC 15 to find, DC 15 to disable;
    affects all targets within a 40 ft. square area, DC 15 save or take 10d10 damage
    and be knocked prone

Animated Net Trap: DC 15 to find, DC 10 to disable;
    affects all targets within a 10 ft. square area, DC 11 save or become restrained
    and take 4d10 damage per round

Thunder Turret: DC 15 to find, DC 15 to disable;
    initiative +3, 1 attack per round, affects all targets within a 20 ft. cone, DC 12 save or take 10d10 thunder damage
    and become deafened for 1d4 rounds

Freeze Ray Trap: DC 10 to find, DC 10 to disable;
    one target, DC 18 save or take 18d10 cold damage
    and become restrained for 1d4 rounds
